import './Courses.css';

const coursesData = [
  {
    department: "Computer Science",
    programs: ["BCA", "MCA", "B.Sc. CS", "M.Sc. CS"]
  },
  {
    department: "Commerce",
    programs: ["B.Com", "M.Com", "BBA"]
  },
  {
    department: "Science",
    programs: ["B.Sc. Physics", "B.Sc. Chemistry", "M.Sc. Biology"]
  },
  {
    department: "Arts",
    programs: ["BA English", "BA History", "MA Political Science"]
  }
];

function Courses() {
  return (
    <div className="courses">
      <h1>Academic Programs</h1>
      <div className="course-list">
        {coursesData.map((dept, index) => (
          <div className="course-card" key={index}>
            <h2>{dept.department}</h2>
            <ul>
              {dept.programs.map((program, i) => (
                <li key={i}>{program}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Courses;
